import React from 'react';
import './RecValue.css';



const RecValue = props => {
    function renderData() {
        return props.data(item =>
            <div key={item.id}>
            <p>Name: {item.name}</p>
            <p>Age: {item.age}</p>
            </div>
        )
    }
    
    return (
        <div>{renderData()}</div>
    );
}



export default RecValue;
